import ApexCharts from "react-apexcharts";
import $ from 'jquery';
function Chart() {

  var options = {
    chart: {
      type: 'line'
    },
    series: [{
      name: 'sales',
      data: [30,40,35,50,49,60,70,91,125]
    }],
    xaxis: {
      categories: [1991,1992,1993,1994,1995,1996,1997, 1998,1999]
    }
  }

    return <ApexCharts
    options={this.state.options}
    series={this.state.series}
    typs='line'
    width={500}
    height={300}
    />
}
export default Chart;
